import React from 'react';
import { Card, Typography } from '@material-ui/core'
import { Route } from 'react-router-dom';

function Header () {
    if (Route = '/search') {
        return(
            <Card>
                <Typography variant='h6'>
                    <h3> Search Google Books</h3>
                </Typography>
            </Card>
        )
    } 
}

export default Header;
